sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GooglePersistentDiskUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'snapshot', 'name']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid']);
    var requestBody = {
        "name": inputs.name.toLowerCase(),
        "description": inputs.description,
        "sourceSnapshot": "projects/" + inputs.projectid + "/global" + "/snapshots/" + inputs.snapshot
    }
    if (inputs.labels.length > 0 ) {
        var labels = {};
        inputs.labels.forEach(function(label) {
          if (label['key'].trim() && label['value'].trim() )
            labels[label['key'].toLowerCase()] = label['value'].toLowerCase();
        })
        requestBody.labels = labels;
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

